import FetchCorpCode from "../ComponentsFetch/FetchStockOrignal/FetchCorpCode"; // CSS 파일을 import

function FinancialStatements() {
    return (
        <div>
            <FetchStockNumDart/>
            <FetchTest/>
            <FetchCorpCode/>
        </div>
    )
}
export default FinancialStatements
